import React, { Component } from "react";
import kep1 from "../img/.jpg";
import kep2 from "../img/album/20200204_113950.jpg";
import kep3 from "../img/album/20200204_114059.jpg";
import kep4 from "../img/album/20200204_114231.jpg";
import SliderComponent from "./SliderComponent.jsx";
import SliderComponent1 from "./SliderComponent.jsx";

class FajtaComponent extends Component {
  render() {
    return (
      <div>
        <article class="tartalom" >
          <figure>
            <img class="img" src={kep1} />
          </figure>
          <section class="szoveg">
            <h2>Neozeelandez roșu</h2>
            <p><h4>1. Forma corpului și tipul</h4> Forma corpului este ușor întinsă, cilindrică, în față și în spate la fel de lat, cu o linie a spatelui simetrică și bine rotunjită în spate. Pieptul este lat, gâtul scurt, cu o ceafă puternică. Membrele sunt puternice și de lungime medie. La femelele mai bătrâne este permisă o gușă mică, corect formată.  
    <h4>2. Greutatea</h4> Greutatea minimă este de 3,00 kg, greutatea normală 4,00 kg, greutatea maximă 5,00 <table class='table'>     <tbody> <tr> <td>kg</td> <td>de la 3,00</td> <td>de la 3,30</td> <td>de la 3,80</td> <td>de la 4,00</td>  </tr> <tr> <td>Puncte</td> <td>7</td> <td>8</td> <td>9</td> <td>10</td> </tr>     </tbody> </table>  
    <h4>3. Părul</h4> Părul este de lungime medie, cu puf dens. Urechile sunt bine acoperite cu păr.  
    <h4>4. Capul și urechile</h4> Capul este puternic, cu fruntea și botul late cu obraji bine definiți. Urechile stau în poziție verticală, sunt cărnoase și ca lungime în armonie cu restul corpului.  
    <h4>5. Culoarea acoperitoare și uniformizarea</h4> Culoarea acoperitoare este roșie, strălucitoare, și se impune b colorare intensă a blănii. Inelele perioculare și ramurile mandibulare sunt ceva mai deschise, dar nu au voie să fie albe. Același lucru este valabil și pt. culoarea de pe burtă, partea interioară a picioarelor și partea inferioară a cozii, Ochii sunt maro, ghearele de culoarea cornului închis. Culoarea trebuie să fie uniformă pe tot corpul, de la nas până la vârful cozii și să coboare până jos pe flancuri.  
    <h4>6. Culoarea de bază</h4> Culoarea de bază trebuie să fie pe cât posibil asemănătoare cu cea exterioară, este o culoare curată, fără amestec și trebuie să ajungă până la rădăcină. Cu cât e mai plină culoarea, cu atât e mai valoros animalul.  
    <h4>7. Sănătate și îngrijire .</h4> Vezi caracteristicile generale.  
    <h4>Defecte ușoare</h4> O gușă mică. O culoare acoperitoare puțin mai deschisă. O nuanță ceva mai deschisă sau mai închisă în partea din spate. Pieptul, lateralele, coapsele și membrele ceva mai deschise. Culoare exterioară puțin pătată, partea inferioară a cozii ceva mai deschisă. Marginile urechile puțin mei deschise sau mai închise. Culoarea de bază mai deschisă sau pregnantă.  
    <h4>Defecte grave</h4> O gușă mare. O blană prea deschisă, fără culoare sau cu fire negre de păr. Delimitare a urechilor neagră, inele periculoase foarte deschise, lâ fel și ramurile mandibufare, pieptul și membrele. Culoare de bază spălăcită complet sau pătată. O culoare diferită a ochilor și a ghearelor decât cea permisă. Partea inferioară a cozii complet albă, la fel și burta. Culoarea de mijloc pregnantă. Orice abatere de la caracteristicile generale."
</p>
          </section>
        </article>
      </div>
    );
  }
}

export default FajtaComponent;
